//App.js

import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import React from 'react';
import AppRouter from "./AppRouter"

function Index() {
  return <h2>Home</h2>;
}

function Today() {
  return <h2>Today</h2>;
}

function Plan() {
  return <h2>Plan</h2>;
}

function App(){
	return(
		<div>
			<h1>Magic Minutes!</h1>
			<AppRouter />
		</div>
  );
}

export default AppRouter;
